import json

def construct_json_object(name, age, email, street, city, state, zipcode, hobbies, school, major, year, friends):
    """"""
    data = {'name': name, 'age': age, 'email': email, 'address': {'street': street, 'city': city, 'state': state, 'zipcode': zipcode}, 'hobbies': hobbies, 'education': {'school': school, 'major': major, 'year': year}, 'friends': friends}
    return json.dumps(data, indent=2)
